  }

  showMessage = () => {
    this.setState({
      message: 'My react app is ready'
    });
  }

  render() {
    return (
      <div>
        <div className="Summary-Container ">
          <h1>Bank Account Summary</h1>
          <div>
            <h2>$10,000</h2>
          </div>
        </div>
        <div className="Main-Container ">

        </div>
      </div>
    );
  }
}

export default Mint;
